from typing import *

class Solution:
    def hitBricks(self, grid: List[List[int]], hits: List[List[int]]) -> List[int]:
        self.grid=grid
        out=[]
        for hit in hits:
            i=hit[0]
            j=hit[1]
            if grid[i][j]!=0:
                grid[i][j]=0
                tmp=0
                if self.isolate(i+1,j):
                    tmp+=self.drop(i+1,j)
                if self.isolate(i,j-1):
                    tmp+=self.drop(i,j-1)
                if self.isolate(i,j+1):
                    tmp+=self.drop(i,j+1)
                out.append(tmp)
            else:
                out.append(0)
        return out
    
    def isolate(self,i,j):
        if i<0:
            return False
        if i>=len(self.grid) or j<0 or j>=len(self.grid[0]):
            return True
        if self.grid[i][j]==0 or self.grid[i][j]==2:
            return True
        self.grid[i][j]=2
        out=self.isolate(i-1,j) and\
            self.isolate(i+1,j) and\
            self.isolate(i,j+1) and\
            self.isolate(i,j-1)
        self.grid[i][j]=1
        return out

    def drop(self,i,j):
        if i<0:
            return 0
        if i>=len(self.grid) or j<0 or j>=len(grid[0]):
            return 0
        if self.grid[i][j]==0:
            return 0
        self.grid[i][j]=0
        return 1+self.drop(i-1,j)+self.drop(i+1,j)+\
               self.drop(i,j-1)+self.drop(i,j+1)

